    Monthly Report (9/1/08 through 9/30/08) is being filed due to a technical issue
    regarding duplicate records created, which affected individuals aggregate year-to-date
    totals. The amended report corrects the aggregate year-to-date total and discloses
    those individuals who should be itemized on Schedule A supporting Line 11ai. Please
    note that the PAC is aware that it may disclose payroll receipts by disclosing
    a single total for the reporting period along with the amount deducted per pay
    period for each contributor. Because the amounts collected per pay period may
    change often during the time covered by a single report, we find that reporting
    individual deductions separately, pursuant to 11 CFR 104.8(b), more accurately
    discloses how the receipts are collected."
